package sandsmad_parser

import (
	"testing"
)

func givenIRangeOverDayRegexesForPage(t *testing.T, page *SandsPage) {
	for _, dm := range DayRegexes {
		match, err := dm.Match(page)
		if err != nil {
			t.Fatalf("got error while matching menu: %v", err)
		}

		if match.NameOfDay != dm.NameOfDay {
			t.Fatalf("expected \"%s\" got \"%s\"", dm.NameOfDay, match.NameOfDay)
		}
	}
}

func givenIGetDishesBack(t *testing.T, f func() ([]DishOfTheDay, error)) {
	dishes, err := f()
	if err != nil {
		t.Fatalf("got error while fetching this weeks dishes: %v", err)
	}

	if len(dishes) != 5 {
		t.Fatalf("expected 5 dishes, got %d", len(dishes))
	}
}

